import React from "react";
import { AppBar, Typography, Toolbar, Tabs, Tab } from "@mui/material";

const Navbar = () => {
    const [value, setValue] = useState(0)
    
    return(
        <>
            <AppBar sx={{background: "#063970"}}>
                <Toolbar> 
                    <img src={require('../images/logo.png')} className="menu--logo"/>
                    <Typography color="common.white">Text</Typography>
                    <Tabs sx={{marginLeft: 'auto'}} textColor='inherit' value={0} indicatorColor="secondary">
                        <Tab label={<span style={{ color: 'white' }}>Home</span>}/> 
                        <Tab label={<span style={{ color: 'white' }}>Activator</span>}/>
                        <Tab label={<span style={{ color: 'white' }}>About</span>}/>
                    </Tabs>
                </Toolbar>
            </AppBar>
        </>
        );
}

export default Navbar;
